import React from 'react';
import { BrowserRouter as Router} from "react-router-dom";

import Navigation from './Navigation';
import Content from './content/Content';

function App() {
  return (
    <Router>
        <Navigation />
        <Content />
    </Router>
  );
}

export default App;
